import './fonts/MSignUp.css';

function Signin() {
  return (
    <div class="background">
    <div class="colorspace">
      <p class="heading">S I G N &nbsp; I N</p>
      <div class="shopimg"/>
    </div>
    <div class="whitespace">
      <p class="loginheading">Log In&nbsp;&nbsp;&nbsp;</p>
      <input class="input" placeholder='Email'></input>
      <input class="input" placeholder='Password'></input>
      <button class="nstep">Next Step</button>
      <div class="btext2">
        <p class="btexta">Don't have an account?</p>
        <button class="btextb2" 
        onClick={(e) => {
          window.location.href = "/signupc";
        }}>Sign Up</button>
      </div>
    </div>
    </div>
  )
}
export default Signin;
